import React, {useEffect, useState} from "react";
import urlFromTemplate from "../config/url";
import {ENDPOINTS} from "../config/endpoints";
import axios from "axios";
import {Table, TableHead, TableBody, TableRow, TableCell, Typography} from '@mui/material';
import {useNavigate} from "react-router-dom";
import {setUser} from "../redux/userSlice";
import {useDispatch} from "react-redux";

const MainPage = () => {

    const navigate = useNavigate();
    const dispatch = useDispatch();

    const [projects, setProjects] = useState([]);
    const [investLogs, setInvestLogs] = useState([]);
    const [interestLogs, setInterestLogs] = useState([]);

    useEffect(() => {
        getCurrentUser();
        getProjects();
        getInvestLogs();
        getInterestLogs();
    }, []);

    const getInterestLogs = async () => {
        const apiUrl = urlFromTemplate(ENDPOINTS.INTEREST_LOG);
        try {
            const response = await axios.get(apiUrl, {
                withCredentials: true,
                headers: {
                    'Accept': 'application/json',
                    'Access-Control-Allow-Credentials': 'true',
                    'Authorization': localStorage.getItem('Token'),
                },
            })
            setInterestLogs(response.data);
        } catch (error) {
            alert(error.response.data.message);
        }
    };

    const getInvestLogs = async () => {
        const apiUrl = urlFromTemplate(ENDPOINTS.LOG);
        try {
            const response = await axios.get(apiUrl, {
                withCredentials: true,
                headers: {
                    'Accept': 'application/json',
                    'Access-Control-Allow-Credentials': 'true',
                    'Authorization': localStorage.getItem('Token'),
                },
            })
            setInvestLogs(response.data);
        } catch (error) {
            alert(error.response.data.message);
        }
    };

    const getProjects = async () => {
        const apiUrl = urlFromTemplate(ENDPOINTS.PROJECT);
        try {
            const response = await axios.get(apiUrl, {
                withCredentials: true,
                headers: {
                    'Accept': 'application/json',
                    'Access-Control-Allow-Credentials': 'true',
                    'Authorization': localStorage.getItem('Token'),
                },
            })
            setProjects(response.data);
        } catch (error) {
            alert(error.response.data.message);
        }
    };

    const getCurrentUser = async () => {
        const apiUrl = urlFromTemplate(ENDPOINTS.USER);
        try {
            const response = await axios.get(apiUrl, {
                withCredentials: true,
                headers: {
                    'Accept': 'application/json',
                    'Access-Control-Allow-Credentials': 'true',
                    'Authorization': localStorage.getItem('Token'),
                },
            })
            dispatch(setUser(response.data));
        } catch (error) {
            alert(error.response.data.message);
        }
    }

    const handleProjectClick = (project) => {
        if (project) {
            navigate('/panel/project', {state: {project}});
        }
    }

    return (<>
        {interestLogs && <>
            <Typography variant="h5" style={{margin: '20px 0 0 10px'}}>
                Last interests
            </Typography>
            <Table>
                <TableHead>
                    <TableRow>
                        <TableCell>Id</TableCell>
                        <TableCell>Amount</TableCell>
                        <TableCell>Type</TableCell>
                        <TableCell>Date time</TableCell>
                    </TableRow>
                </TableHead>
                <TableBody>
                    {interestLogs.map((project) => (
                        <TableRow key={project.id} style={{cursor: 'pointer'}}
                                  onClick={() => handleProjectClick(project)}>
                            <TableCell>{project.id}</TableCell>
                            <TableCell>{project.amount}</TableCell>
                            <TableCell>{project.type}</TableCell>
                            <TableCell>{project.dateTime}</TableCell>
                        </TableRow>
                    ))}
                </TableBody>
            </Table>
        </>}
        {investLogs && <>
            <Typography variant="h5" style={{margin: '20px 0 0 10px'}}>
                Last investments
            </Typography>
            <Table>
                <TableHead>
                    <TableRow>
                        <TableCell>Id</TableCell>
                        <TableCell>Amount</TableCell>
                        <TableCell>Description</TableCell>
                        <TableCell>Invested sum</TableCell>
                        <TableCell>Collected pool</TableCell>
                        <TableCell>Total pool</TableCell>
                    </TableRow>
                </TableHead>
                <TableBody>
                    {projects.map((project) => (
                        <TableRow key={project.id} style={{cursor: 'pointer'}}
                                  onClick={() => handleProjectClick(project)}>
                            <TableCell>{project.id}</TableCell>
                            <TableCell>{project.title}</TableCell>
                            <TableCell>{project.description}</TableCell>
                            <TableCell>{project.investedSum}</TableCell>
                            <TableCell>{project.collectedSum}</TableCell>
                            <TableCell>{project.poolSum}</TableCell>
                        </TableRow>
                    ))}
                </TableBody>
            </Table>
        </>}
        {projects && <>
            <Typography variant="h5" style={{margin: '20px 0 0 10px'}}>
                Projects
            </Typography>
            <Table>
                <TableHead>
                    <TableRow>
                        <TableCell>Id</TableCell>
                        <TableCell>Title</TableCell>
                        <TableCell>Description</TableCell>
                        <TableCell>Invested sum</TableCell>
                        <TableCell>Collected pool</TableCell>
                        <TableCell>Total pool</TableCell>
                    </TableRow>
                </TableHead>
                <TableBody>
                    {projects.map((project) => (
                        <TableRow key={project.id} style={{cursor: 'pointer'}}
                                  onClick={() => handleProjectClick(project)}>
                            <TableCell>{project.id}</TableCell>
                            <TableCell>{project.title}</TableCell>
                            <TableCell>{project.description}</TableCell>
                            <TableCell>{project.investedSum}</TableCell>
                            <TableCell>{project.collectedSum}</TableCell>
                            <TableCell>{project.poolSum}</TableCell>
                        </TableRow>
                    ))}
                </TableBody>
            </Table>
        </>}
    </>);
};

export default MainPage;
